import Head from 'next/head'
import Layout, { siteTitle } from '../components/layout'


import AboutContainer from '../components/aboutContainer/aboutContainer'

import styles from './page_styles/projects.module.scss'
import React from 'react'
import TimeLine from '../components/aboutContainer/timeLine'
import ResponsiveComponent from '../components/responsiveComponent/responsive';

import GithubLink from "../components/profile_link/github_link";



export default function Home({
  allPostsData
}: {
  allPostsData: {
    date: string
    title: string
    id: string
  }[]
}) {
  return (

    <Layout home>

      <Head>
        <title>{siteTitle}</title>

      </Head>
      <div className={styles.mainContainer}>

        {AboutContainer({
          img_url: "/images/IMG_7328.jpg",
          position1: 50,
          position2: 70,
          children: [
            <div style={{ bottom: 0 }}>
              {ResponsiveComponent(
                <div style={{ color: 'white', fontSize: '20px', width: '100%', textAlign: 'left', textShadow: '2px 2px 5px rgba(65, 65, 65, 0.6)', paddingTop: '30vh' }}>
                  <h1>About This Website</h1>
               This website uses Next.js which is an server side 
               
               {GithubLink("https://github.com/angyuhang98/fhir-theranos")}
              
                </div>
              )

              }

            </div>




          ]
        })}
        {ResponsiveComponent([TimeLine({
          title: "Time Line",
          items: [{
            dateTime: "1/9/2020", title: "Publish of first version",
            //etail:"improve UI and UX, adding more columns to the data table, menu to control the appearance of UI, data visualization"
            detail: <div>
              <ul>- UI, UX improvements</ul>
              <ul>- More columns in data table</ul>

              <ul>- Data visualization</ul>

              <ul>- User can hide unwanted features and columns</ul>

            </div>
          },
          {
            dateTime: "mid 7/2020", title: "Version 1",
            //detail:"implement user interface of user login, data table of patients data, add and removal of the \patients to monitor, connection to server." 
            detail: <div>

              <ul>- Interface of user login</ul>
              <ul>- Data table of patients data</ul>

              <ul>- Add and removal of the patients to monitor</ul>

              <ul> - Connection to server</ul>

            </div>
          },
          ]
        }),
        <div>
          <h2>Learning Outcome and Self Evaluation</h2>
          <h3>What did I learn?</h3>
          <ul>- Responsive UI/UX design</ul>
          <ul>- Gained more hand on experience about web development and design</ul>
          <ul>- build reusable components for React.js frameworks</ul>
          <ul></ul>
    


          <h3>What need to be improved?</h3>
          <ul>- As a beginner, I aim too high for first projects, wasted too much time on researching and debugging</ul>
          <ul>- Lacks of prototyping, waste a lot of time when built and designed UI and UX simultaneously</ul>
        </div>]
        )}


      </div>








    </Layout>
  )
}
